import React, { useState } from 'react';

export default function SideMenu() {
  const [openApp, setOpenApp] = useState('users');

  return (
    <nav style={{
      width: 220, background: '#363b4c', color: 'white', paddingTop: 20, minHeight: 'calc(100vh - 60px)'
    }}>
      <div
        style={{ padding: '1rem', cursor: 'pointer', background: openApp === 'users' ? '#484d5e' : 'none' }}
        onClick={() => setOpenApp(openApp === 'users' ? null : 'users')}
      >
        Users
      </div>
      {openApp === 'users' && (
        <div style={{ paddingLeft: 20, background: '#484d5e' }}>
          <div style={{ padding: '0.5rem 0', cursor: 'pointer' }}>User List (coming soon)</div>
          <div style={{ padding: '0.5rem 0', cursor: 'pointer' }}>Profile</div>
        </div>
      )}
      {/* Future apps go here */}
    </nav>
  );
}
